    private def mapN = new Map8P[A1[F], A2[F], A3[F], A4[F], A5[F], A6[F], A7[F], A8[F]] {}

    def map1[B[_[_]]](f: A1[F] => B[F]): Prod8[F, B, A2, A3, A4, A5, A6, A7, A8] =
